import React from 'react';
import CrudTable from '../components/CrudTable';
import { healthDataApi } from '../services/api';

const fields = [
  { key: 'healthId', label: 'ID', noForm: true },
  { key: 'patientId', label: 'Patient ID', type: 'number' },
  { key: 'condition', label: 'Medical Condition', placeholder: 'e.g. Diabetes' },
  { key: 'allergies', label: 'Allergies' },
  { key: 'medications', label: 'Current Medications' },
  { key: 'surgeryHistory', label: 'Surgery History' },
  { key: 'notes', label: 'Additional Notes' },
];

export default function HealthData() {
  return (
    <div>
      <h1 style={{ fontFamily: "'DM Serif Display', serif", fontSize: 26, marginBottom: 6 }}>Health Records</h1>
      <p style={{ color: 'var(--text-light)', marginBottom: 24, fontSize: 14 }}>Patient health history and medical background</p>
      <CrudTable title="Health Data" fields={fields} api={healthDataApi} idField="healthId" />
    </div>
  );
}
